import React, { useState } from 'react'
import { useEffect } from 'react';
import { Link } from 'react-router-dom';
import { Header, Segment } from 'semantic-ui-react'

export default function About() {
    const [offsetY, setOffsetY] = useState(0);
    const handleScroll = () => setOffsetY(window.pageYOffset);

    useEffect(() => {
        window.addEventListener('scroll', handleScroll);

        return () => window.removeEventListener('scroll', handleScroll);
    },[]);

    const renderContent = () => (
        <>
        <div>
            <Header as='h1'>Цветан Стојановски</Header>
            <Header as='h2'>Моите достигнувањеа во React</Header>
        </div>
        <div>
            <p>Оваа страница претставува презентација на она што јас до сега го имам достигнато во React. Доколку Ве интересира целиот код можете да го погледате на <Link to='https://github.com/Cvetan65/prevoz'>GitHub</Link></p>
        </div>


        </>
    );
    return (
        <section cla>
           <div/>
           <div/>
           <div></div>
        </section>
    )
}
